import { Component } from "react";

export default class Org extends Component {
    constructor(props) {
        super(props)
    }

    imgSrc() {
        return `/api/orgs/${this.props.orgID}/logo`
    }

    render() {
        return (
            <div>
                <img src={this.imgSrc()} className="org-logo" />
            </div>
        );
    }
}
